import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import Contact_body from "../components/Contact_body";

function Contact() {
    return(
        <>
            <Header/>
            <Contact_body/>
            <Footer/>
        </>
    );
}
export default Contact;
